class Solution:
    def findSubstring(self, s, words):
        ## TOO SLOW
        l = len(words[0])
        l_max = len(words) * l
        index = []
        word_dict = {}
        count_dict = {}

        if len(s) >= l_max:
            for w in words:
                if w in word_dict:
                    word_dict[w] += 1
                else:
                    word_dict[w] = 1
                    count_dict[w] = 0

            for i in range(len(s)):
                if s[i:i + l] in word_dict:
                    count_dict[s[i:i + l]] += 1
                    for j in range(1, l_max // l):
                        if s[i + j * l: i + (1 + j) * l] in word_dict:
                            count_dict[s[i + j * l: i + (1 + j) * l]] += 1
                            if count_dict == word_dict:
                                index.append(i)
                                break
                        else:
                            break
                    # reset count_dict
                    for key in count_dict.keys():
                        count_dict[key] = 0
                else:
                    continue
        return index

    def findSubstring2(self, s, words):
        l_max = len(words)
        l = len(words[0])
        index = []
        word_dict = {}
        count_dict = {}
        word_s = set(words)

        for w in words:
            if w in word_dict:
                word_dict[w] += 1
            else:
                word_dict[w] = 1
                count_dict[w] = 0

        for i in range(len(s)):
            for key in count_dict.keys():
                count_dict[key] = 0

            print(s[i:i+l])
            print(s[i+l_max * l - l:i+l_max * l])
            if i+l_max * l < len(s) and s[i:i+l] in word_s and s[i+l_max * l - l:i+l_max * l] in word_s:
                count_dict[s[i:i+l]] += 1
                count_dict[s[i+l_max * l - l:i+l_max * l]] += 1

                if count_dict == word_dict:
                    index.append(i)
                    continue
                for j in range(1, l_max - 1):
                    if s[i+l*j:i+l*j+l] in word_s:
                        count_dict[s[i+l*j:i+l*j+l]] += 1
                        if count_dict == word_dict:
                            index.append(i)
                            continue
                    else:
                        break
        print(index)
        return index




